ReactDom.render(
<>
    <h1 className="headingStyle">Hello world!!</h1>
    <div className="card">
        <h3 className="cardTitle">{todotitle}</h3>
        <p className="cardDesc">{tododesc}</p>
        <p className="cardFooter">{dateName +"/"+monthName+"/"+currentYear}</p>
    </div>
</>,
document.getElementById("root"));
